import Image from 'next/image'
import { IoGrid } from "react-icons/io5";
import { RiShoppingBasketFill } from "react-icons/ri";
import { IoSearchOutline } from "react-icons/io5";
import { CgOptions } from "react-icons/cg";
import { RiMenu4Line } from "react-icons/ri"
import { useEffect, useState } from "react";
import { FiAlignRight } from 'react-icons/fi'

import Link from 'next/link'
import { navbarLinks as link } from '../../NavigationMenu'





const Nav = ({ toggle, clicks }) => {
    const [click, setClick] = useState(false)
    // const handleClick = () => setClick(!click);
    const closemenu = () => setClick(false)

    return (
        <div>

            <nav className="flex justify-between items-center w-full h-[5em]  text-block relative  font-mono navbar"

            >

                <div className="text-white md:ml-10 ml-6">
                    <h2 className="text-2xl">ğ–‹ğ–—ğ–Šğ–˜ğ¡ğ–‘ğ– ğ–—ğ–ğ–‰ğ–Š</h2>
                </div>


                <div className="md:flex  mt-[8px] hidden ">


                    <div className="space-x-4 mr-4 orderlist text-white font-serif">
                        {link.map((nav) => {
                            const { id, text, path } = nav;
                            return (

                                <Link as={`/${nav.path}`} href='/[pages]'>

                                    <a>{text}</a>
                                </Link>

                            )
                        })}
                    </div>


                </div>

                <div className="md:mr-20 mr-[40px]">
                    <div className="" onClick={toggle}>
                        {
                            click ? <FiAlignRight className="text-white text-2xl" />

                                : <RiMenu4Line className="text-white text-2xl" />
                        }
                    </div>

                    <button className="text-white  hidden">Be A MEMBER</button>
                </div>
            </nav>
        </div>
    )
}


export default Nav
